import React from "react";

function ResumeForm() {
  return (
    <div id="formDiv">
      <form>
        <label htmlFor="personName" value="Personal Details">
          Personal Details
        </label>
        <input type="text" id="personName" placeholder="John "></input>
      </form>
    </div>
  );
}

export default ResumeForm;
